import { Button, Flowbite } from 'flowbite-react';
import React from 'react';

const CustomBtn = () => {

    const customTheme = {
        color: {
            black: '#0d1728',
            blackGray: '#11242e',
            blue: '#00B7FF',
            white: '#FFF',
        },
    };



    return (
        <Flowbite theme={{ theme: customTheme }}>
            <Button color="blackGray">Đăng nhập</Button>
        </Flowbite>
    );
};

export default CustomBtn;
